import { getMessages } from "../Chats"

const MessageBubble = ( {textMessage, onClick} ) => {

    return (
        <div>
            <div className="chat-bubble" onClick={getMessages}>
                <p>{textMessage.message}</p>
            </div>
        </div>
    )
}

export default MessageBubble
